import React, {Component} from "react";
import  {Button}  from '@material-ui/core';
import EditModal from "../container/EditModal";

class FirstButton extends Component{
	render() {
		return (
			<Button  color="secondary">
				<EditModal />
			</Button>
		)
	}
}

export default FirstButton
